PREFIX s223: <http://data.ashrae.org/standard223#>
PREFIX brick: <https://brickschema.org/schema/Brick/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?zone ?zoneLabel ?propLabel ?alcEndpoint ?mpcEndpoint
WHERE {
  # Zones (targets)
  ?zone a s223:Zone .
  OPTIONAL { ?zone rdfs:label ?zoneLabel }
  # Properties associated with the zone
  ?zone s223:hasProperty ?prop .
  OPTIONAL { ?prop rdfs:label ?propLabel }
  # Filter to keep only non‑writable properties (writable absent or false)
  OPTIONAL { ?prop brick:writable ?writable }
  FILTER ( !BOUND(?writable) || ?writable = false )
  # ALC endpoint reference (generic Brick endpoint)
  OPTIONAL { ?prop brick:endpoint ?alcEndpoint }
  # MPC endpoint reference (specific Brick MPC name)
  OPTIONAL { ?prop brick:mpc_db_name ?mpcEndpoint }
}
ORDER BY ?zone ?propLabel

